import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

const AePanelDemo = () => {
  const [isLibraryOpen, setIsLibraryOpen] = useState(false);
  const [weekNumber, setWeekNumber] = useState(1);
  const [status, setStatus] = useState('');
  const [showDialog, setShowDialog] = useState(false);
  const [notifyAlex, setNotifyAlex] = useState(true);

  const formatWeekNumber = (num) => {
    return num.toString().padStart(2, '0');
  };

  const handleRenderClick = () => {
    setShowDialog(true);
  };

  const handleConfirmRender = () => {
    setShowDialog(false);
    setStatus('âœ¨ Render started');
    setTimeout(() => {
      setStatus('');
      setWeekNumber(prev => prev + 1);
    }, 3000);
  };

  return (
    <div className="max-w-md mx-auto bg-[#2D2D2D] p-6 rounded-xl shadow-xl">
      {/* Title */}
      <motion.h2
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
        className="text-2xl mb-6 text-[#E4E4E4]"
      >
        Kaufland Assets Library
      </motion.h2>

      {/* Render Queue Button */}
      <motion.button
        whileHover={{ scale: 1.02 }}
        whileTap={{ scale: 0.98 }}
        onClick={handleRenderClick}
        className="w-full p-4 mb-4 rounded-lg bg-[#4CAF50] text-white text-xl flex items-center justify-between border-2 border-white/10"
      >
        <span className="flex items-center gap-2">
          <span>ðŸŽ¬</span>
          Deliver the Week!
        </span>
        <span>â–¼</span>
      </motion.button>

      {/* Logo Library Button */}
      <motion.button
        whileHover={{ scale: 1.02 }}
        whileTap={{ scale: 0.98 }}
        onClick={() => setIsLibraryOpen(!isLibraryOpen)}
        className="w-full p-4 rounded-lg bg-[#FF416C] text-white text-xl"
      >
        Open Logo Library
      </motion.button>

      {/* Status Messages */}
      <AnimatePresence>
        {status && (
          <motion.div
            initial={{ opacity: 0, y: -10 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0 }}
            className="mt-4 p-3 rounded-lg bg-green-500/10 text-green-400 border border-green-500/20 flex items-center gap-2"
          >
            <motion.span
              animate={{ 
                rotate: [0, 360],
                scale: [1, 1.2, 1]
              }}
              transition={{ duration: 0.5 }}
            >
              âœ¨
            </motion.span>
            {status}
          </motion.div>
        )}
      </AnimatePresence>

      {/* Render Dialog */}
      <AnimatePresence>
        {showDialog && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="fixed inset-0 bg-black/50 flex items-center justify-center"
            onClick={() => setShowDialog(false)}
          >
            <motion.div
              initial={{ scale: 0.9 }}
              animate={{ scale: 1 }}
              exit={{ scale: 0.9 }}
              className="bg-[#2D2D2D] p-6 rounded-xl max-w-sm w-full mx-4"
              onClick={e => e.stopPropagation()}
            >
              <h3 className="text-2xl text-green-500 mb-6 text-center">Start Render?</h3>
              <h3 className="text-xl text-white mb-4">Confirm Render</h3>
              <div className="flex items-center gap-4 mb-6">
                <span className="text-gray-400">Week Number:</span>
                <input
                  type="number"
                  value={formatWeekNumber(weekNumber)}
                  onChange={(e) => setWeekNumber(Math.max(1, parseInt(e.target.value) || 1))}
                  className="bg-[#363636] border border-green-500/30 rounded p-2 text-green-400 w-20 text-center"
                />
              </div>
              <div className="flex gap-3">
                <motion.button
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  onClick={handleConfirmRender}
                  className="flex-1 p-3 rounded-lg bg-green-500 text-white"
                >
                  Confirm
                </motion.button>
                <motion.button
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  onClick={() => setShowDialog(false)}
                  className="flex-1 p-3 rounded-lg bg-gray-600 text-white"
                >
                  Cancel
                </motion.button>
              </div>
            </motion.div>
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};

export default AePanelDemo;
